  \"Tissue concentrations of elemental and organochlorine compounds in sea otters
  in Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 14,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:25.104229\",\n\t\"name\":
  \"tissue-concentrations-of-elemental-and-organochlorine-compounds-in-sea-otters-in-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sea otters (Enhydra lutris) are found in
  coastal waters of Alaska from the southeast part of the state through the Aleutian
  Islands. Sea otters and their principle prey, benthic invertebrates, are comparatively
  sedentary; therefore, studying contaminant exposure in sea otters provides an opportunity
  to examine large-scale spatial variation in contamination of the nearshore environment.
  The U.S. Fish and Wildlife Service obtained tissue samples primarily from subsistence
  harvested animals taken by Alaska Natives that were provided to the Sea Otter Biosampling
  Program, a joint effort of the Service and the Alaska Sea Otter and Steller Sea
  Lion Commission. Samples were grouped into the following three geographic areas:
  southeast Alaska including Yakutat Bay; southcentral Alaska including Prince William
  Sound and Cook Inlet; and southwest Alaska through the Aleutian Islands, including
  the Kodiak Archipelago. Sea otter liver and kidney tissues were analyzed for a suite
  of trace elements/metals and organochlorines, including polychlorinated biphenyls
  (PCBs). Summary and comparative statistics were performed with parametric and nonparametric
  statistical tests, depending on the percent of each analyte detected in each group.
  Overall, sea otter tissues from southcentral Alaska had higher concentrations of
  select metals and trace elements when compared to the other geographic areas. Organochlorine
  pesticides were either not detected or were detected at low concentrations in most
  otters, with only beta-BHC occurring in enough samples to warrant a statistical
  evaluation. A few individual animals had elevated concentrations of PCB Aroclors,
  indicating that PCB contamination may be present in localized areas. However, for
  most samples in which contaminants were detected, levels were below biologically
  significant levels. The general pattern of contamination among groups was southcentral
  > southwest > southeast.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
